import React from "react";
import './App.css';
import { nft_mint } from './Create';

function Explore(){
    return(
        <body>
            <div className='container fluid mt-1'>
                <div className='row textCenter'>
                    <img src={nft_mint}/>
                </div>
            </div>
        </body>
    );
}

export default Explore;
